import React, { useState, useEffect } from 'react';
import { PhoneIcon, EnvelopeIcon, MapPinIcon } from '@heroicons/react/24/outline';

interface ContactForm {
  name: string;
  email: string;
  phone: string;
  message: string;
}

const Contact: React.FC = () => {
  const [formData, setFormData] = useState<ContactForm>({
    name: '',
    email: '',
    phone: '',
    message: ''
  });

  useEffect(() => {
    // Load Calendly widget script
    const script = document.createElement('script');
    script.src = 'https://assets.calendly.com/assets/external/widget.js';
    script.async = true;
    document.body.appendChild(script);

    return () => {
      // Cleanup script when component unmounts
      document.body.removeChild(script);
    };
  }, []);

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement>) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Contact form submitted:', formData);
    // TODO: Implement form submission
  };

  return (
    <div className="overflow-x-hidden">
      {/* Hero Section */}
      <section className="relative min-h-[20vh] flex flex-col items-center justify-center overflow-hidden" style={{ background: 'linear-gradient(135deg, #006699 0%, #343652 100%)' }}>
        <div className="container mx-auto flex flex-col items-center justify-center py-8">
          <h1 className="text-4xl sm:text-5xl lg:text-6xl font-extrabold text-white leading-tight text-center drop-shadow-lg" style={{textShadow: '0 4px 24px rgba(0,0,0,0.25)'}}>
            Contact MAX
          </h1>
          <p className="text-lg sm:text-xl text-white/90 text-center mt-2 mb-2 max-w-2xl">
            Schedule your confidential discovery call or request a callback.
          </p>
        </div>
      </section>
      {/* Main Content */}
      <div className="container max-w-7xl mx-auto px-4 py-12">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-12 items-start">
          {/* Quick Enquiry Form */}
          <div className="bg-blue-50 rounded-xl shadow p-8 max-w-lg w-full mx-auto">
            <h2 className="text-2xl font-bold mb-6 text-gray-900">Quick Enquiry</h2>
            <form onSubmit={handleSubmit} className="space-y-5">
              <div>
                <label htmlFor="name" className="block text-sm font-medium text-gray-700 mb-1">Full Name*</label>
                <input type="text" id="name" name="name" value={formData.name} onChange={handleInputChange} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:ring-blue-500 focus:border-blue-500" required />
              </div>
              <div>
                <label htmlFor="email" className="block text-sm font-medium text-gray-700 mb-1">Email*</label>
                <input type="email" id="email" name="email" value={formData.email} onChange={handleInputChange} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:ring-blue-500 focus:border-blue-500" required />
              </div>
              <div>
                <label htmlFor="phone" className="block text-sm font-medium text-gray-700 mb-1">Phone*</label>
                <input type="tel" id="phone" name="phone" value={formData.phone} onChange={handleInputChange} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:ring-blue-500 focus:border-blue-500" required />
              </div>
              <div>
                <label htmlFor="postcode" className="block text-sm font-medium text-gray-700 mb-1">Postcode*</label>
                <input type="text" id="postcode" name="postcode" className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:ring-blue-500 focus:border-blue-500" required />
              </div>
              <div>
                <label htmlFor="businessType" className="block text-sm font-medium text-gray-700 mb-1">Business Type</label>
                <input type="text" id="businessType" name="businessType" className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:ring-blue-500 focus:border-blue-500" />
              </div>
              <div>
                <label htmlFor="message" className="block text-sm font-medium text-gray-700 mb-1">Message (Optional)</label>
                <textarea id="message" name="message" value={formData.message} onChange={handleInputChange} rows={4} className="mt-1 block w-full rounded-md border-gray-300 shadow-sm focus:ring-blue-500 focus:border-blue-500" />
              </div>
              <div className="flex items-start">
                <input id="confidential" name="confidential" type="checkbox" className="h-4 w-4 text-blue-600 border-gray-300 rounded" />
                <label htmlFor="confidential" className="ml-2 block text-sm text-gray-700">I understand all information will be kept strictly confidential</label>
              </div>
              <button type="submit" className="w-full bg-teal-700 hover:bg-teal-800 text-white font-semibold py-3 rounded-lg shadow-lg transition-all text-lg">Submit Request</button>
            </form>
          </div>
          {/* Calendly Widget */}
          <div className="w-full flex flex-col items-center justify-start">
            <h2 className="text-2xl font-bold mb-4 text-gray-900 text-center">Book a Discovery Call</h2>
            <p className="text-gray-700 mb-4 text-center">Instantly schedule a confidential call with our team.</p>
            <div className="rounded-lg overflow-hidden w-full" style={{ minHeight: '500px', maxWidth: 420 }}>
              <div 
                className="calendly-inline-widget" 
                data-url="https://calendly.com/xcllusive-info/30min?primary_color=006699" 
                style={{ minWidth: '320px', height: '700px' }}
              />
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
